package org.santihs.poointerfaces.printing.model;import java.util.ArrayList;import java.util.List;public class Curriculum extends PaperSheet  implements Printable {    private String person;    private String race;    private List<String> experiences;    public Curriculum(String contents, String person, String race) {        super(contents);        this.person = person;        this.race = race;        this.experiences = new ArrayList<>();    }    public Curriculum addExperience(String experiencie){        this.experiences.add(experiencie);        return this;    }    @Override    public String print() {        StringBuilder sb = new StringBuilder("Name: ");        sb.append(person).append("\n")                .append("Contents: ").append(super.contents)                .append("\n").append("Race: ").append(this.race)                .append("\n").append("Experiences: ")                .append("\n");        for (String experience :                this.experiences) {            sb.append("- ").append(experience).append("\n");        }        return sb.toString();    }}